import React from 'react';
import { Doughnut } from 'react-chartjs-2';



function DoughnutChart ({chartDays}) {
    console.log(chartDays)
    const data = {
        labels: Object.keys(chartDays),
        datasets: [
          {
            label: '# of Votes',
            data: Object.values(chartDays.cases),
            backgroundColor: [
              'rgba(255, 99, 132, 0.2)',
              'rgba(54, 162, 235, 0.2)',
              'rgba(255, 206, 86, 0.2)',

            ],
            borderColor: [
              'rgba(255, 99, 132, 1)',


            ],
            borderWidth: 1,
          },
          {
            label: '# of Votes',
            data: Object.values(chartDays.cases),
            backgroundColor: [

              'rgba(54, 162, 235, 0.2)',


            ],
            borderColor: [

              'rgba(54, 162, 235, 1)',


            ],
            borderWidth: 1,
          },
        ],
      };
    return(
  <>
    <div className='header'>
      <h1 className='title'>Doughnut Chart</h1>
      <div className='links'>
        <a
          className='btn btn-gh'
          href='https://github.com/reactchartjs/react-chartjs-2/blob/master/example/src/charts/Doughnut.js'
        >
          Github Source
        </a>
      </div>
    </div>
    <Doughnut data={data} />
  </>
    )
}

export default DoughnutChart
